import './footer.css'
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div className="footer">
     <link h> <i class=" fa-brands fa-github"></i></link>
     <i class="fa-brands fa-linkedin"></i>
     <i class="fa-brands fa-stack-overflow"></i>
    </div>
  );
};

export default Nav;
